import React, { useState } from 'react';
import Button from '../Button';
import Perfil from "../../imgs/1.png"; 

import Input from '../NewPost';

import {
  Container,
  Topside,
  Logo,
  MenuButton,
  HomeIcon,
  ProfileIcon,
  Botside,
  Avatar,
  ProfileData,
  ExitIcon,
} from './styles';

const MenuBar: React.FC = () => {
  const [open, setOpen] = useState(Input);

  return (
    <Container>
      <Topside>
        <Logo> 
        SIEGE
        </Logo>

        <MenuButton className="active">
          <HomeIcon />
          <span>PÃ¡gina Inicial</span>
        </MenuButton>

        <MenuButton >
          <ProfileIcon />
          <span>Perfil</span>
        </MenuButton>
      </Topside>

        <Button onClick={()=> setOpen(open)}>
          <span>Evento</span>
        </Button>



      <Botside>
        <Avatar>
          <img src={Perfil} />
        </Avatar>  
        <ProfileData>
          <strong>Administrador</strong>
        </ProfileData>
        <ExitIcon />
      </Botside>

    </Container>
  );
};

export default MenuBar;
